class salle{
    #id;
    #number;
    #nature;

    get id(){
        return this.#id;

    }

    set id(value){
        this.#id = value;
    }

    get number(){
        return this.#number;

    }


    set number(value){
        this.#number = value;
    }


    get nature(){
        return this.#nature;

    }


    set nature(value){
        this.#nature = value;
    }


}